function Header() {
    return (
        <nav>
            <h1>Hello a third time!</h1>
            <ul>
                <li>Thing 1</li>
                <li>Thing 2</li>
                <li>Thing 3</li>
            </ul>
        </nav>
    )
}

export default Header
